import Footer from './Component/Footer.js';
import Carousel1 from'./Component/react-carousel-component-master/src/Carousel';
import BackToTop from './Component/BackToTop.js';




function App(){
  return(
    <div>
      <Navbar />
      <Banner />
      <Body />
      <Carousel1 />
      <Footer /> 
      <BackToTop />


    </div>


  );
}
export default App
